function extractArticles() {
  var articles = [];
  var nodes = document.querySelectorAll('a.post-tile-box');
  nodes.forEach(function(node, idx) {
    var url = node.href;
    var title = '';
    var titleElem = node.querySelector('.h2');
    if (titleElem) {
      title = titleElem.innerText.trim();
    }
    var coverElem = node.querySelector('img');
    var coverImageUrl = '';
    if (coverElem) {
      coverImageUrl = coverElem.getAttribute('data-srcset') || coverElem.getAttribute('src') || '';
    }
    var authorElem = node.querySelector('.author_lable');
    var author = authorElem ? authorElem.innerText.trim() : '';
    var timeElem = node.querySelector('time');
    var publishedAt = timeElem ? timeElem.getAttribute('datetime') : '';
    var summary = '';
    var obj = {
      url: url,
      title: title,
      author: author,
      publishedAt: publishedAt,
      position: idx + 1,
      coverImageUrl: coverImageUrl,
      articleKind: 'column'
    };
    articles.push(obj);
  });
  return articles;
}
